import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomePage from "./components/HomePage";
import Login from "./components/Loginpage"; // Updated import statement
import signuppage from "./components/signuppage"; // Updated import statement
function App() {
  return (
    <Router>
      <Routes>
        {/* Defining routes for different pages */}
        <Route path="/signuppage" element={<HomePage />} />
        <Route path="/loginpage" element={<Login />} /> {/* Updated component reference */}
      </Routes>
    </Router>
  );
}

export default App;
